import requests

def verify(protocol,ip,port):
    url = protocol+'://'+ip+':'+str(port)
    print('testing if apache httponly cookie information disclose vul')
    newurl = url + '/'
    cookie = {'acunetixCookie': ''}
    try:
        response = requests.get(newurl,cookies=cookie,verify=False,timeout=5)
        if 'Cookie: acunetixCookie=AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA' in response.text:
            msg = 'Found apache httponly cookie information disclose vul in url:' + newurl + ' .'
            print(msg)
            number = 'v92'
            return True, url, number, msg
        else:
            pass
    except Exception as e:
        msg = str(e)
        number = 'v0'
        return False,url,number,msg
    msg = 'There is no apache httponly cookie information disclose vul'
    number = 'v0'
    return False, url, number, msg